import React from 'react'
import Contact from './Contact'

const Form = ({ onSubmit, name, phone }) => {
    return (
        <>
            
            <form onSubmit={onSubmit}>
                <div>
                    name: <input
                        value={name.value}
                        onChange={name.onChange}
                    />
                </div>
                <div>
                    number: <input
                        value={phone.value}
                        onChange={phone.onChange}
                    />
                </div>
                <div>
                    <button type="submit">Add</button>
                </div>
            </form>
        </>
    )
}

export default Form
